import React, { Fragment } from "react";
// import { HulkFooter } from "./components/common/footer/HulkFooter";
// import { HulkNavbar } from "./components/common/navbar/HulkNavbar";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./pages/Login";
import RouterDos from "./routes/RouterDos";
import ProtectedRoute from "./routes/ProtectedRoute";

// function App() {
//   return (
//     <>
//       <Router>
//         <Routes>
//           <Route exact path="/login" component={Login} />
//           <ProtectedRoute path="/" component={RouterDos} />
//         </Routes>
//       </Router>
//     </>
//   );
// }

const App = () => {
  return (
    <Router>
      <Fragment>
        <Routes>
          <Route exact path="/" element={<ProtectedRoute />}>
            <Route exact path="/*" element={<RouterDos />} />
          </Route>
          <Route exact path="/login" element={<Login />} />
        </Routes>
      </Fragment>
    </Router>
  );
};
export default App;
